import React from 'react';
import Home from './Components/Home/Home';
import './App.css';

import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
import Svg from './Components/Header/Svg/Svg';



function App() {

  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path='/' element={<Home />} />
        <Svg />
        </Routes>
      </div >
    </Router>
  )
}

export default App;
